import React from 'react';

function Footer() {
    return (
        <footer className="bg-gray-200 p-4 mt-8 text-right fixed bottom-0 w-full">
            <div className="container mx-auto">
                <p className="text-sm font-bold text-gray-600">API Version 1.0</p>
            </div>
        </footer>
    );
}

export default Footer;
